import React from 'react';
import { Navbar} from '../components';

const PastPapers = () => {
  return (
    <div className="w-full min-h-screen">
      <Navbar />

      <div className="flex w-full ml-[5%] mt-[10%] grid grid-cols-4">

          <div className="bg-black w-[100%] h-[100%]">
            <p>Biology</p>
          </div>

      </div>
</div>
  );
};

export default PastPapers;
